        def convertToBinaryData(self, imageLocation):
            with open(imageLocation, 'rb') as file:
                blobData = file.read()
            return blobData
            
        # Database 
        # Create a database or connect to one 
        self.conn = sqlite3.connect('driver_data.db')
        # Create a cursor
        c = self.conn.cursor()
        # Create the table 
        c.execute("CREATE TABLE IF NOT EXISTS ddata (frame TEXT, speed FLOAT, signal INTEGER, x INTEGER, y INTEGER, brake INTEGER);")
        
        print("ddata Table is Created")
        
        # Insert test values into database   
        c.execute("INSERT INTO ddata (frame, speed, signal, x, y, brake) VALUES ('5870','7.58','1','608', '659', '1')")
        c.execute("INSERT INTO ddata (frame, speed, signal, x, y, brake) VALUES ('5871','7.25','1','1226', '660', '1')")
        c.execute("INSERT INTO ddata (frame, speed, signal, x, y, brake) VALUES ('5872','6.69','1','1679', '513', '1')")
        c.execute("INSERT INTO ddata (frame, speed, signal, x, y, brake) VALUES ('5873','6.47','1','1684', '537', '1')")
        
        
        # Commit changes 
        self.conn.commit()
        
        tableData=("SELECT * FROM ddata")
        c.execute(tableData) 
        self.records = c.fetchall()
       
        self.counter = 0
        self.rows = ("SELECT COUNT(*) FROM ddata")

